Posted @withregram • @coachnikkilew Today was amazing!  I competed in my first show (@ocbofficialpage) and received a Pro Card after placing 1st in the Wellness 35+ category.  I never imagined that I would participate in the sport of bodybuilding, and I can honestly say that it is one of the best decisions I have ever made.  Today’s show was the first, but definitely not the last. 

My trainer, @gabyvegaifbbpro, is exceptional!  For those of you who have been wondering who helped me develop my body, her name is Gaby.  In addition to training my body, Gaby also tailors my meal plans so that I get results.  Thank you soooooo much, Gaby! 🤗

